import './App.css';
import { MapContainer } from 'react-leaflet'
import Maps from './components/Maps';
import Markers from './components/Markers';
import { marker } from 'leaflet';

const App = () => {
  return (
    <MapContainer center={Markers.center} zoom={13} scrollWheelZoom={true}>
      <Maps />
      <Markers />


    </MapContainer>
  )
}

export default App;
